  false,\n\t\"url\": null,\n\t\"notes\": \"Rapid Assessment Transects were conducted
  in 2007 in the Papahanaumokuakea Marine National Monument of the Northwest Hawaiian
  Islands Coral Reef Ecosystem Reserve. The surveys were led by Dr. Paul Jokiel and
  Mr. Erik Franklin along various depth contours at 7 unique atolls or islands. This
  dataset consists of digital still transect images (JPG files). Digital images are
  important for future researchers to resolve any questions about how the image data
  were interpreted for the quantitative database, to provide the opportunity to re-analyze
  the images using other methods, and to return to the same locations for future comparisons.
  In a separate NODC Accession (0000881), benthic data for substrate types and coverages
  are given, which were derived objectively from these photographic images using PhotoGrid,
  a software package which analyzes random points on images of coral reefs and substrate.\",\n\t\"license_title\":
